import Card from "react-bootstrap/Card";

const CardComponent = (props) => {
  return (
    // <Card style={{ width: props.width }}>
    //   <Card.Body>{props.children}</Card.Body>
    // </Card>
    <div className="card" style={{ width: props.width }}>
      <div></div>
    </div>
  );
};

export default CardComponent;
